let baseUrl = {
    url: "https://jsonplaceholder.typicode.com/"
}
export const get = (endpoint) => {
    try {
        fetch(baseUrl.url + endpoint)
            .then((res) =>  {console.log(res.json(),'resss');res.json()})
            .then((json) => {console.log(json);json})
            .catch((err) => {
                return err
            })
    } catch (err) {
        console.error(err)
    }
}
